const data = [
  { name: 'Pão', quantityStock: 25, price: 1.99 },
  { name: 'Livro', quantityStock: 13, price: 10.99 },
  { name: 'tenis', quantityStock: 2, price: 42.99 },
  { name: 'carro', quantityStock: 5, price: 20300.99 },
  { name: 'luva', quantityStock: 800, price: 8.75 },
];

export default data;
